import React from "react";
import { ExpenseItem } from "./ExpenseItem";

export function ExpensesList(props) {
    if (props.items.length === 0) {
        return <p>There are no expenses.</p>;
    }

  return props.items.map((expense) => (
        <ExpenseItem
          key={expense.id}
          title={expense.title}
          amount={expense.amount}
          date={expense.date}
        />
      ))
}
